def count_subsequences_of_101(s: str) -> int:
    sub = ''
    (m, n) = (len(s), len(sub))
    table = [0] * n
    for i in range(m):
        previous = 1
        for j in range(n):
            current = table[j]
            if s[i] == sub[j]:
                table[j] += previous
            previous = current
    return table[n - 1] if n else 1

